import React, { Component } from 'react';
import Modal from 'react-awesome-modal';



class RecordMedicalDetail extends Component {
  constructor(props) {
    super();
    // this.handleShow = this.handleShow.bind(this);
    // this.handleClose = this.handleClose.bind(this);

    this.state = {

      thongtinbenhnhan: null,
      ketquaxetnghiep: null,
      CommentByDoctor: null
    };
  }
  // componentDidMount=()=>{
  //   console.log(this.props.dataRecordDetail);
  //   this.filterData(this.props.dataRecordDetail)
  // }

  filterData = (dataRecord) => {
    let nhiptim = dataRecord.split("#");
    let thongtinbenhnhan = nhiptim[0];
    thongtinbenhnhan = thongtinbenhnhan.split(";");
    let ketquaxetnghiep = nhiptim[1];
    ketquaxetnghiep=ketquaxetnghiep.split(";");
    console.log(ketquaxetnghiep[0]);
    let CommentByDoctor = nhiptim[2].split(";");
    this.setState({
      thongtinbenhnhan,ketquaxetnghiep,CommentByDoctor
    })

  }

  render() {
    return (
      <div className="container">
        <div className="row">
          <h3 className="alignCenter">Phần khám và chuẩn đoán bệnh</h3>
          <div className="col-md-4">
            <ul>
              <li>ngay:{this.props.realTime}</li>
              <li>ho ten:</li>
              <li>que quan:</li>
              <li>tuoi:</li>
              <li>nghe nghiep:</li>


            </ul>
          </div>
          <div className="col-md-4">
            <ul>
              <li>nhip tim:</li>
              <li>huyet ap:</li>
              <li>can nang:</li>
              <li>chieu cao:</li>


            </ul>
          </div>
        </div>
        <div className="row">
          <div>
            <table>
              <tr>
                <th>Tên các xét nghiệm</th>
                <th>kết quả </th>
              </tr>
              <tr>
                <td>Alfreds Futterkiste</td>
                <td>Maria Anders</td>

              </tr>
              <tr>
                <td>Centro comercial Moctezuma</td>
                <td>Francisco Chang</td>

              </tr>
              <tr>
                <td>Ernst Handel</td>
                <td>Roland Mendel</td>

              </tr>
              <tr>
                <td>Island Trading</td>
                <td>Helen Bennett</td>

              </tr>
              <tr>
                <td>Laughing Bacchus Winecellars</td>
                <td>Yoshi Tannamuri</td>

              </tr>
              <tr>
                <td>Magazzini Alimentari Riuniti</td>
                <td>Giovanni Rovelli</td>

              </tr>
            </table>
          </div>
        </div>
        <div className="row">
          <a onClick={event => this.filterData(this.props.dataRecordDetail)}>click</a>
          <p>Diễn biến bệnh : {this.props.dataRecordDetail}</p>

          <p>Chuẩn đoán bệnh : {this.props.dataRecordDetail}</p>
          {/* <p>Điều trị : {this.props.dataRecordDetail}</p> */}
        </div>
      </div>
    )
  }
}

export default RecordMedicalDetail;
